<!DOCTYPE html>
<html lang="es">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.5/dist/css/bootstrap.min.css" rel="stylesheet"
        integrity="sha384-SgOJa3DmI69IUzQ2PVdRZhwQ+dy64/BUtbMJw1MZ8t5HZApcHrRKUc4W0kG879m7" crossorigin="anonymous">
    <title>Document</title>
    <title>Grid Layout</title>
</head>

<body>
    <div class="grid-layout">


        <nav class="navbar navbar-expand-sm bg-body-tertiary">
            <div class="container-fluid bs-warning">
                <a class="navbar-brand" href="#">Sport Zone</a>
                <button class="navbar-toggler" type="button" data-bs-toggle="collapse"
                    data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false"
                    aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNavDropdown">

                    <ul class="navbar-nav ms-auto">
                        <li class="nav-item">
                            <a class="nav-link active" aria-current="page" href="#">Inicio</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#">integrantes</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#">Usuarios</a>
                        </li>
                        <li class="nav-item dropdown">
                            <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown"
                                aria-expanded="false">
                                Dropdown link
                            </a>
                            <ul class="dropdown-menu">
                                <li><a class="dropdown-item" href="#">Action</a></li>
                                <li><a class="dropdown-item" href="#">Another action</a></li>
                                <li><a class="dropdown-item" href="#">Something else here</a></li>
                            </ul>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>

        <div class="container-fluid  row ">
            <div class="col-1">
                <div class="btn-group-vertical d-flex justify-content-center align-items-center mt-auto"  role="group"
                    aria-label="Vertical button group">
                    <button type="button" class="btn btn-primary">Pagos</button>
                    <button type="button" class="btn btn-primary">Nuevos Ingresos</button>
                    <button type="button" class="btn btn-primary">Materiales</button>
                    <button type="button" class="btn btn-primary">Button</button>
                </div>
                <script>
                    const botonAlternar = document.getElementById("boton-alternar");
                    const contenedorBotones = document.getElementById("contenedor-botones");

                    botonAlternar.addEventListener("click", () => {
                        contenedorBotones.classList.toggle("d-none");
                    });
                </script>
            </div>
            <div class="col-9">
                <div id="carouselExampleIndicators" class="carousel slide">
                    <div class="carousel-indicators">
                        <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="0"
                            class="active" aria-current="true" aria-label="Slide 1"></button>
                        <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="1"
                            aria-label="Slide 2"></button>
                        <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="2"
                            aria-label="Slide 3"></button>
                    </div>
                    <div class="carousel-inner ">
                        <div class="carousel-item active ms-5" style="max-width: 700px; ">
                            <img src="data:image/jpeg;base64,"
                                class="d-block w-100" alt="...">
                        </div>
                        <div class="carousel-item ms-5" style="max-width: 700px;">
                            <img src="data:image/jpeg;base64," class="d-block w-100" alt="...">
                        </div>
                        <div class="carousel-item ms-5" style="max-width: 700px;">
                            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSX3uN4hbV2WEyudWaiMJ9YMGf9uz47Dkmk-w&s" class="d-block w-100" alt="...">
                        </div>
                    </div>
                    <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleIndicators"
                        data-bs-slide="prev">
                        <span class="carousel-control-prev-icon" aria-hidden="true"></span>
                        <span class="visually-hidden">Previous</span>
                    </button>
                    <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleIndicators"
                        data-bs-slide="next">
                        <span class="carousel-control-next-icon" aria-hidden="true"></span>
                        <span class="visually-hidden">Next</span>
                    </button>
                </div>
            </div>
        </div>

        <div class="container-fluid caja c5 bg.primary">

        </div>

    </div>

    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.5/dist/js/bootstrap.bundle.min.js"
        integrity="sha384-k6d4wzSIapyDyv1kpU366/PK5hCdSbCRGRCMv+eplOQJWyd1fbcAu9OCUj5zNLiq"
        crossorigin="anonymous"></script>
</body>

</html>